// copyright date
var date = new Date().getFullYear();
document.getElementById("copyyear").innerHTML = date;
//handle email list form validation and submission to google sheet
var $form = $('form#emailList'),
      url = 'https://script.google.com/macros/s/AKfycbwyrX07lltNM-fKdtz_4O_I8A0xQ9Sg83Fp9HSpPRThN5E2Jhk/exec'

$('#submitEmailList').on('click', function(e) {
  e.preventDefault();
  
  var valid = true;
  if(document.emailList.email.value == "")
     {
        $(".alert-container").html("<div class='alert alert-danger'>Please enter your email address.</div>");
        document.emailList.email.focus();
        valid = false;
        return false;
     }
  if(document.emailList.name.value == "")
    {
      $(".alert-container").html("<div class='alert alert-danger'>Please enter your name.</div>");
      document.emailList.name.focus();
      valid = false;
      return false;
    }
  if(valid)
    $.ajax({
      url: url,
      method: "GET",
      dataType: "json",
      data: $form.serializeObject(),
      error: function(xhr, desc, err) {
        $('.alert-container').html('<div class="alert alert-danger">Sorry, an error has occurred.  Please try again.</div>');
        console.log("error");
      },
      success: function() {
        $(".alert-container").html(" <div class='alert alert-success'>Thank you for signing up!</div>");
      },
    })
  return false;
})